import React, { Component } from "react";
import Swiper from "react-id-swiper";

class Gallery extends Component {
    render() {
        const params = {
            slidesPerView: "auto",
            spaceBetween: 30,
            pagination: {
                el: ".swiper-pagination",
                clickable: true
            }
        };
        return (
            <div>
                <Swiper {...params}>
                    <div>Slide #1</div>
                    <div>Slide #2</div>
                    <div>Slide #3</div>
                    <div>Slide #4</div>
                    <div>Slide #5</div>
                </Swiper>
            </div>
        );
    }
}

export default Gallery;
